import logo from "./logo.svg";
import "./App.css";

import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  Outlet
} from "react-router-dom";

import {router, routerFromElements} from "./router";

function App() {
  return (
    <div className="App">
      <Outlet></Outlet>
      <nav>
        <Link to={"/calendar"} />
        <Link to={"/feed"} />
        <Link to={"/about"} />
        {/* <Link to={"/manager"} /> */}
      </nav>
    </div>
  );
}

export default App;
